import { useEffect } from 'react';
import './Sidebar.css'
import { NavLink } from 'react-router-dom'
import $ from 'jquery'

export function Sidebar() {
    

    
    return (
        <div className="side-bar">
            <button><NavLink to="/login" className="side-tab">Login</NavLink></button>
            <NavLink to="/learning" className="side-tab">학습하기</NavLink>
            <NavLink to="/notice" className="side-tab">공지사항</NavLink>
            <NavLink to="/question" className="side-tab">질문 게시판</NavLink>
            <NavLink to="/learnrecord" className="side-tab">학습 내역</NavLink>
            <NavLink to="/vulnerable" className="side-tab">취약점</NavLink>
            <NavLink to="/pointrecord" className="side-tab">포인트 내역</NavLink>
            <NavLink to="/createques" className="side-tab">생성한 문제</NavLink>
            <NavLink to="/writer" className="side-tab">작성한 글</NavLink>
        </div>
    );
}
